We have done most of our setup required in previous setup, so decoding tokens will be fairly simple. For authentication we will provided the encoded token in an http header, using the format Bearer {token}. So to ease our process, we will directly provide header in this function and extract the token's value // use actix_web::http::header::HeaderValue;
// use serde_json::{from_value, Value};
pub fn decode_token(auth_header: &HeaderValue) -> Result<Claims, AuthError> { match auth_header.to_str() { Ok(auth_header_string) => { let token = auth_header_string.trim_start_matches("Bearer "); match decode_header(token) { Ok(jwt_header) => { match decode::<Value>( token, &DecodingKey::from_secret(JWT_SECRET_KEY), &Validation::new(jwt_header.alg), ) { Ok(raw_token) => { let decoded = from_value::<Claims>(raw_token.claims.clone()); match decoded { Ok(claims) => Ok(claims), Err(e) => Err(AuthError::Claims(e)), } } Err(_) => Err(AuthError::InvalidToken), } } Err(e) => { dbg!(e); Err(AuthError::InvalidToken) } } } Err(_) => Err(AuthError::InvalidAuthorizationHeader), }
}

